import styles from "../styles/_hamburgerMenu.module.scss";

const HamburgerMenu = () => {
    return (
        <>
            <div>
                <div className={styles.hamburger}>
                    <input className={styles} type="checkbox" />
                    <div class="hamburger_lines">
                        <span class="lines line1"></span>
                        <span class="lines line2"></span>
                        <span class="lines line3"></span>
                    </div>
                    <ul class="menu-items">
                        <li>Home</li>
                        <li>About</li>
                        <li>Contact</li>
                        <li>Blog</li>
                        <li>Log Out</li>
                    </ul>
                </div>
            </div>
        </>
    );
};

export default HamburgerMenu;
